        "<p>\uC21C\uC218 \uC6B0\uB9AC \uAE30\uC220\uB85C \uB9CC\uB4E0 \uC6B0\uC8FC \uBC1C\uC0AC\uCCB4 \uB204\uB9AC\uD638\u{1F680} \uC138\uACC4 7\uBC88\uC9F8 \uB2EC \uADA4\uB3C4 \uD0D0\uC0AC\uC120 \uB2E4\uB204\uB9AC\u{1F6F0} \uB300\uD55C\uBBFC\uAD6D \uC6B0\uC8FC \uC0B0\uC5C5 \uBC1C\uC804\uC5D0 \uAE30\uC5EC\uD574 \uC628 \uD55C\uD654\uC758 \uCCA8\uB2E8 \uAE30\uC220\uB825 \u2018\uC6B0\uC8FC \uBC38\uB958\uCCB4\uC778\u2019\uACFC \uD568\uAED8 \uB300\uD55C\uBBFC\uAD6D\uC758 \uC6B0\uC8FC\uC2DC\uB300\uB97C \uD5A5\uD55C \uB3C4\uC804\uC740 \uACC4\uC18D\uB429\uB2C8\uB2E4. \uC6B0\uC8FC\uB85C \uAC00\uB294 \uAD50\uD1B5\uC218\uB2E8\uC778 \uBC1C\uC0AC\uCCB4 \uC790\uCCB4 \uAC1C\uBC1C \uBC0F \uC81C\uC791\uBD80\uD130 \uC778\uACF5\uC704\uC131 \uAE30\uC220\uB825\uC744 \uD1B5\uD55C \uC9C0\uC0C1\uC5D0\uC120 \uC5BB\uC744 \uC218 \uC5C6\uB294 \uC815\uBCF4\uB294 \uBB3C\uB860, \uC9C0\uAD6C \uBC16 \uC6B0\uC8FC\uC758 \uBB34\uD55C\uD55C \uC790\uC6D0\uC744 \uD5A5\uD55C \uD0D0\uC0AC\uC758 \uBC1C\uAC78\uC74C\uC5D0\uB3C4 \uBC15\uCC28\uB97C \uAC00\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uC138\uACC4 7\uBC88\uC9F8\uB85C \uBB34\uAC8C 1t\uC774\uC0C1\uC758 \uC778\uACF5\uC704\uC131\uACFC \uC6B0\uC8FC\uC120\uC744 \uC790\uB825\uC73C\uB85C \uC3D8\uC544 \uC62C\uB9B4 \uC218 \uC788\uB294 \uAD6D\uAC00 \uB300\uD55C\uBBFC\uAD6D\uC758 \uC6B0\uC8FC\uC2DC\uB300, \uD55C\uD654\uAC00 \uD568\uAED8 \uD569\uB2C8\uB2E4.</p>"
